Selen live DvdRip.avi

Selen in hard-action con audio in diretta dal set. Ansimi, gemiti, urla: tutto rigorosamente live. Una Selen cosi' non l'avete mai sentita! Silvio Bandinelli dirige Selen. Audio live. Inediti dal set di &quot;Cuore di Pietra&quot; e &quot;Rosso e Nero&quot;.

